import React from 'react';
import styles from './navbar.module.css';
import { Link } from 'react-scroll';

const navlinks = [
    {
        name: 'Contact',
        link: 'mycontact'
    },
    {
        name: 'Projects',
        link: 'myprojects'
    },
    {
        name: 'Skills',
        link: 'myskills'
    },
    {
        name: 'Services',
        link: 'myservices'
    },
    {
        name: 'About',
        link: 'herosection'
    },
    {
        name: 'Home',
        link: ''
    },
]

const Links = () => {

    return (

        navlinks.map((navlink, index) =>
            <Link 
            key={index} 
            activeClass="active" 
            to={navlink.link}
            spy={true} 
            smooth={true} 
            offset={-195} 
            duration={500}
            >
            {navlink.name}
            </Link>
        )
    )
}

const Navbar = () => {


    return (
        <div className='navbar navbar-expand-sm container-fluid' id='navbar'>
            <p className='navbar-brand'>MyFolio</p>
            <button className='navbar-toggler' type='button' data-bs-toggle='collapse' data-bs-target='#collapsibleNavbar'>
                <span className='navbar-toggler-icon'></span>
            </button>
            <div className='collapse navbar-collapse' id='collapsibleNavbar'>
                <Links/>
            </div>
        </div>
    );
}

export default Navbar;
